import './App.css';
import React, { useState } from 'react';

function App() {

  const [count, setCount] = useState(0);

  return (
    <div className="App">

      <body className="parent">

        <div id="page_menu">
          DAVID LEYDON
        </div>
        <div id="page_content">
          <div id="interactive_text">
            <a>I</a>nteractive Resume
          </div>
          <div id="interactive_small_text">
            The website is an interactive application, displaying both my resume & some skills I've learned along the way.
          </div>
          <button id="interactive_start">
            START
          </button>

        </div>


      </body>
    </div>
  );
}

export default App;
